import React from "react";
import forecastCSS from "../styles/forecast.module.css";
const x2 = [20, 30, 40, 60, 70];

function graphMaking() {
  for (let i = 0; i < 5; i++) {
    return <line x1="0" y1="0" x2={x2[i]} y2="70" stroke="white" />;
  }
}

function ForecastGraph() {
  return (
    <>
      <svg className={forecastCSS.graph}>{graphMaking()}</svg>
    </>
  );
}

export default ForecastGraph;
